class RegisterComponent {
    constructor(userService, toast, Spinner) {
        this.userService = userService;
        this.toast = toast;
        this.Spinner = Spinner;
        this.counties = [];
    }
    ngOnInit() {
        // Getting counties
        this.userService.getCounties().subscribe((data) => {
            this.counties = data.counties;
            // console.log(this.counties);
        });
    }
    registerAccount(form) {
        const fname = this.fname;
        const lname = this.lname;
        const email = this.email;
        const phoneNumber = this.phoneNumber;
        const password1 = this.password1;
        const password2 = this.password2;
        const country = this.country;
        const county = this.county;
        const sub_county = this.sub_county;
        const city = this.city;
        const postal_address = this.postal_address;
        const tet = "'" + this.phoneNumber + "'";
        const phoneValid = tet.charAt(1) + tet.charAt(2) + tet.charAt(3);
        if (fname && lname && email && phoneNumber && password1 && password2 && country && sub_county && city && postal_address) {
            if (phoneValid === '254') {
                if (password1 === password2) {
                    this.userService.getUserDetails(email).subscribe(res => {
                        this.user = res;
                        if (this.user.id === null) {
                            this.userService.registerUser(password1, email, fname, lname, phoneNumber, country, county, sub_county, city, postal_address);
                        }
                        else {
                            this.toast.error(`Email account ${email} has already been taken. Please click login`, 'Error!', {
                                timeOut: 8500,
                                progressBar: true,
                                progressAnimation: 'increasing',
                                positionClass: 'toast-top-right'
                            });
                        }
                    });
                }
                else {
                    this.toast.error(`Passwords Mismatch!!!`, 'Error!', {
                        timeOut: 1500,
                        progressBar: true,
                        progressAnimation: 'increasing',
                        positionClass: 'toast-top-right'
                    });
                }
            }
            else {
                this.toast.error(`Please enter valid phone number in format 254*******`, 'Invalid Phone Number', {
                    timeOut: 1500,
                    progressBar: true,
                    progressAnimation: 'increasing',
                    positionClass: 'toast-top-right'
                });
            }
        }
        else {
            this.toast.error(`Please Complete the form`, 'Incomplete form', {
                timeOut: 1500,
                progressBar: true,
                progressAnimation: 'increasing',
                positionClass: 'toast-top-right'
            });
        }
    }
}


